import React from "react";
import ReactDOM from "react-dom";
import "../componentCss/ContactFormCss.css";

class ContactForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      placeHolder: ["Your name", "Your email address", "Your phone number"],
    };
  }

  render() {
    return (
      <div
        className="m-6 l-6 c-12 contact-wrapper"
        data-aos="fade-down"
        data-aos-duration="1500"
      >
        <p className="contact-message"> Leave a message for me </p>
        {this.state.placeHolder.map((holder, i) => {
          return (
            <input type="text" placeholder={holder[i]} className="form-input" />
          );
        })}

        <div className="form-input special">
          <input
            type="text"
            placeholder="Extended message"
            className="form-input special-form"
          />
        </div>
        <button className="btn">
          {" "}
          <a href="https://mail.google.com/mail/u/0/#inbox?compose=new">
            Send this message
          </a>{" "}
        </button>
      </div>
    );
  }
}

export default ContactForm;
